import { get } from 'utils/api';
import axios from 'axios';
export default function companyStore(){
  return {
    company: [],
    async getNote (username){
      try{
      
        const result = await get(`Permission/Auth/GetListCompanyByUsername?username=${username}`)
        
      this.company= result.data
    
        console.log(result)
      }catch(err){

      }
    },

  }
}
